import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";
import Line from "../line";

const DivStyled = styled.div`
  position: absolute;
  top: ${(props) => props.top};
  left: ${(props) => props.left};
`;

const RootSkillTree = ({ lineColor, translate, rotation, length }) => {
  return (
    <DivStyled>
      ici
      <Line
        top={20}
        left={50}
        color={lineColor}
        rotation={45}
        translate={"0,0"}
        length={500}
      />
    </DivStyled>
  );
};

RootSkillTree.propTypes = {
  skillColor: PropTypes.string,
  lineColor: PropTypes.string,
};

export default RootSkillTree;
